    <div>
    <BrowserRouter>
    <Routes>
      <Route path='/' element={<Home/>} />
      <Route path='/create' element={<NewEmployee/>} />
      <Route path='/update/:id' element={<Update/>} />
    </Routes>
  </BrowserRouter>
    </div>
  );
}

export default App;
